import React,{useState} from 'react'
import {Link} from 'react-router-dom'


const Home = () => {
 const [name , setName] = useState("");

const match = () =>{
  name!=="Abbas" && alert("This is an alert for not match")
}
  return (
    <div>
        <h1>
            this is home
        </h1>
        <input type="text" name='name' value={name} onChange={(e)=>setName(e.target.value)} />

        <button onClick={match}><Link to="/about">ancher</Link></button>
    </div>
  )
}

export default Home
